import React from "react";
import "./App.css";
import Navigation from "./components/NavBar";
import Linksr1 from "./components/Link-R1";
import Linksr2 from "./components/Link-R2";
import Linksr3 from "./components/Link-R3";
import { Navbar } from "reactstrap";

Button.propTypes = {
  active: PropTypes.bool,
  "aria-label": PropTypes.string,
  block: PropTypes.bool,
  color: PropTypes.string, // default: 'secondary'
  disabled: PropTypes.bool,
  outline: PropTypes.bool
};

function App() {
  return (
    <div className="App">
      <Navigation />
      <div className="container-fluid">
        <div className="row">
          <div className="col-sm-12">
            <Linksr1></Linksr1>
          </div>
        </div>
        <div className="row">
          <div className="col-sm-12">
            <Linksr2></Linksr2>
          </div>
        </div>
        <div className="row">
          <div className="col-sm-12">
            <Linksr3></Linksr3>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
